import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  background: #f2f3fe;
  margin-top: 7%;
  width: 100%;
  @media (min-width: 568px) {
    margin-top: 47%;
  }
  @media (min-width: 568px) {
    margin-top: 13.3%;
  }
  .impact-inner {
    padding: 15% 5% 35% 5%;
    display: grid;
    gap: 20%;
    @media (min-width: 568px) {
      padding: 10% 5% 28% 5%;
    }
    @media (min-width: 768px) {
      display: flex;
      justify-content: center;
      align-items: center;
      gap: 1%;
    }
    .impact-left {
      display: grid;
      gap: 10%;

      @media (min-width: 768px) {
        width: 100%;
        gap: 6%;
      }
      h4 {
        font-weight: 700;
        font-size: 20px;
        @media (min-width: 568px) {
          font-size: 43px;
          font-weight: 500;
        }
        @media (min-width: 768px) {
          font-size: 25px;
          font-weight: 600;
        }
      }
      h2 {
        font-size: 32px;
        line-height: 49px;
        @media (min-width: 768px) {
          font-size: 40px;
          font-weight: 800;
          line-height: 80px;
        }
      }
      p {
        font-size: 19px;
        font-weight: 300;
        line-height: 30px;
        letter-spacing: 1px;
        @media (min-width: 568px) {
          line-height: 35px;
        }
        @media (min-width: 768px) {
          font-size: 2px;
          line-height: 45px;
        }
      }
    }
    .impact-right {
      @media (min-width: 768px) {
        width: 90%;
      }
      .vid {
        width: 100%;
        height: auto;
        border-radius: 0 0 10px 10px;
        @media (min-width: 768px) {
          height: 30vh;
        }
      }
    }
  }
`;

function Impact() {
  return (
    <Wrapper>
      <div className="impact-inner">
      <div className="impact-left">
          <h4>Uncommon Impact</h4>
          <h2>
            Education = <br /> Earning Power.
          </h2>
          <p>
            Our mission is to help unemployed young adults from low-income
            communities launch their careers in the technology industry.
          </p>
      </div>
      <div className="impact-right">
        <video src="./images/vid.mp4"  controls className="vid"></video>
      </div>
      </div>
    </Wrapper>
  );
}

export default Impact;
